import React from 'react';
import './ExploreContainer.css';
import RenderMarkdown from "./Render-Markdown/Render-Markdown";

interface ContainerProps {
    name: string;
}

const ExplorerContainer: React.FC<ContainerProps> = ({name}) => {
    console.log(name);
    return (
        <div className="container">
            <strong>{name}</strong>
            <p>Explore <a target="_blank" rel="noopener noreferrer" href="https://ionicframework.com/docs/components">UI
                Components</a></p>
<RenderMarkdown markdownFile={name}></RenderMarkdown>
        </div>
    );
};

export default ExplorerContainer;
